contracts/BlazePresale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title Blaze Presale Contract
 * @dev Handles presale with automatic fund distribution
 * 
 * Presale Details:
 * - Target: $500,000
 * - Price: $0.00417 per BLAZE
 * - Tokens: 120M BLAZE
 * - Min contribution: $100 (in BNB)
 * - Max contribution: $10,000 per wallet
 * 
 * Fund Distribution:
 * - 60% → Liquidity (locked)
 * - 40% → Operational Budget (team, dev, marketing)
 */
contract BlazePresale is Ownable, ReentrancyGuard {

    // Presale Parameters
    uint256 public constant HARD_CAP = 500000 * 10**18; // $500k in wei equivalent
    uint256 public constant SOFT_CAP = 100000 * 10**18; // $100k minimum
    uint256 public constant MIN_CONTRIBUTION = 100 * 10**18; // $100
    uint256 public constant MAX_CONTRIBUTION = 10000 * 10**18; // $10,000
    uint256 public constant TOKENS_FOR_SALE = 120_000_000 * 10**18; // 120M BLAZE
    uint256 public constant TOKEN_PRICE = 417 * 10**13; // $0.00417 per token

    // Presale State
    bool public presaleActive;
    bool public presaleFinalized;
    uint256 public totalRaised;
    uint256 public totalTokensSold;
    uint256 public startTime;
    uint256 public endTime;

    // Wallets
    address public liquidityWallet;
    address public operationalWallet;
    address public tokenAddress;

    // Participant tracking
    mapping(address => uint256) public contributions;
    mapping(address => uint256) public tokenAllocations;
    mapping(address => bool) public hasClaimed;
    address[] public participants;

    // Events
    event PresaleStarted(uint256 startTime, uint256 endTime);
    event ContributionReceived(address indexed contributor, uint256 amount, uint256 tokens);
    event TokensClaimed(address indexed participant, uint256 amount);
    event PresaleFinalized(uint256 totalRaised, uint256 liquidityAmount, uint256 operationalAmount);
    event RefundIssued(address indexed participant, uint256 amount);

    constructor(
        address _liquidityWallet,
        address _operationalWallet
    ) Ownable(msg.sender) {
        require(_liquidityWallet != address(0), "Invalid liquidity wallet");
        require(_operationalWallet != address(0), "Invalid operational wallet");

        liquidityWallet = _liquidityWallet;
        operationalWallet = _operationalWallet;
    }

    /**
     * @dev Set token address (can only be set once)
     */
    function setTokenAddress(address _tokenAddress) external onlyOwner {
        require(tokenAddress == address(0), "Token already set");
        require(_tokenAddress != address(0), "Invalid token address");
        tokenAddress = _tokenAddress;
    }

    /**
     * @dev Start the presale
     */
    function startPresale(uint256 durationInDays) external onlyOwner {
        require(!presaleActive, "Presale already active");
        require(tokenAddress != address(0), "Token not set");
        require(durationInDays > 0 && durationInDays <= 90, "Invalid duration");

        presaleActive = true;
        startTime = block.timestamp;
        endTime = block.timestamp + (durationInDays * 1 days);

        emit PresaleStarted(startTime, endTime);
    }

    /**
     * @dev Contribute to presale
     */
    function contribute() external payable nonReentrant {
        require(presaleActive, "Presale not active");
        require(block.timestamp >= startTime && block.timestamp <= endTime, "Presale not in progress");
        require(msg.value >= MIN_CONTRIBUTION, "Below minimum contribution");
        require(contributions[msg.sender] + msg.value <= MAX_CONTRIBUTION, "Exceeds maximum contribution");
        require(totalRaised + msg.value <= HARD_CAP, "Hard cap reached");

        // Calculate tokens
        uint256 tokens = (msg.value * 10**18) / TOKEN_PRICE;
        require(totalTokensSold + tokens <= TOKENS_FOR_SALE, "Not enough tokens available");

        // Track contribution
        if (contributions[msg.sender] == 0) {
            participants.push(msg.sender);
        }

        contributions[msg.sender] += msg.value;
        tokenAllocations[msg.sender] += tokens;
        totalRaised += msg.value;
        totalTokensSold += tokens;

        emit ContributionReceived(msg.sender, msg.value, tokens);

        // Auto-finalize if hard cap reached
        if (totalRaised >= HARD_CAP) {
            _finalize();
        }
    }

    /**
     * @dev Finalize presale (owner or auto when hardcap/time reached)
     */
    function finalizePresale() external onlyOwner {
        require(presaleActive, "Presale not active");
        require(block.timestamp > endTime || totalRaised >= HARD_CAP, "Cannot finalize yet");
        _finalize();
    }

    /**
     * @dev Internal finalize function
     */
    function _finalize() internal {
        require(!presaleFinalized, "Already finalized");
        require(totalRaised >= SOFT_CAP, "Soft cap not reached");

        presaleActive = false;
        presaleFinalized = true;

        // Distribute funds
        uint256 liquidityAmount = (totalRaised * 60) / 100;  // 60%
        uint256 operationalAmount = totalRaised - liquidityAmount; // 40%

        // Transfer funds
        (bool liquiditySuccess, ) = liquidityWallet.call{value: liquidityAmount}("");
        require(liquiditySuccess, "Liquidity transfer failed");

        (bool operationalSuccess, ) = operationalWallet.call{value: operationalAmount}("");
        require(operationalSuccess, "Operational transfer failed");

        emit PresaleFinalized(totalRaised, liquidityAmount, operationalAmount);
    }

    /**
     * @dev Claim tokens after presale is finalized
     */
    function claimTokens() external nonReentrant {
        require(presaleFinalized, "Presale not finalized");
        require(!hasClaimed[msg.sender], "Already claimed");
        require(tokenAllocations[msg.sender] > 0, "No tokens to claim");

        uint256 amount = tokenAllocations[msg.sender];
        hasClaimed[msg.sender] = true;

        IERC20 token = IERC20(tokenAddress);
        require(token.transfer(msg.sender, amount), "Token transfer failed");

        emit TokensClaimed(msg.sender, amount);
    }

    /**
     * @dev Refund if soft cap not reached
     */
    function claimRefund() external nonReentrant {
        require(!presaleActive, "Presale still active");
        require(block.timestamp > endTime, "Presale not ended");
        require(totalRaised < SOFT_CAP, "Soft cap reached, no refunds");
        require(contributions[msg.sender] > 0, "No contribution to refund");

        uint256 amount = contributions[msg.sender];
        contributions[msg.sender] = 0;

        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Refund failed");

        emit RefundIssued(msg.sender, amount);
    }

    /**
     * @dev Emergency end presale (owner only)
     */
    function emergencyEndPresale() external onlyOwner {
        require(presaleActive, "Presale not active");
        presaleActive = false;
    }

    /**
     * @dev Get presale info
     */
    function getPresaleInfo() external view returns (
        bool active,
        bool finalized,
        uint256 raised,
        uint256 tokensSold,
        uint256 participantCount,
        uint256 timeRemaining
    ) {
        active = presaleActive;
        finalized = presaleFinalized;
        raised = totalRaised;
        tokensSold = totalTokensSold;
        participantCount = participants.length;

        if (block.timestamp >= endTime) {
            timeRemaining = 0;
        } else {
            timeRemaining = endTime - block.timestamp;
        }
    }

    /**
     * @dev Get user info
     */
    function getUserInfo(address user) external view returns (
        uint256 contribution,
        uint256 tokenAllocation,
        bool claimed
    ) {
        contribution = contributions[user];
        tokenAllocation = tokenAllocations[user];
        claimed = hasClaimed[user];
    }

    /**
     * @dev Get all participants
     */
    function getParticipants() external view returns (address[] memory) {
        return participants;
    }

    /**
     * @dev Withdraw remaining tokens after presale (if any)
     */
    function withdrawRemainingTokens() external onlyOwner {
        require(presaleFinalized, "Presale not finalized");
        IERC20 token = IERC20(tokenAddress);
        uint256 balance = token.balanceOf(address(this));
        uint256 allocated = 0;

        // Calculate total allocated tokens
        for (uint256 i = 0; i < participants.length; i++) {
            if (!hasClaimed[participants[i]]) {
                allocated += tokenAllocations[participants[i]];
            }
        }

        uint256 withdrawable = balance - allocated;
        require(withdrawable > 0, "No tokens to withdraw");
        require(token.transfer(owner(), withdrawable), "Withdrawal failed");
    }

    // Receive function to accept BNB
    receive() external payable {
        revert("Use contribute() function");
    }
}

contracts/BlazeTokenPresale.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title Blaze Token - Presale Edition
 * @dev Ultimate utility token for Blaze Wallet with optimized presale tokenomics
 * 
 * Total Supply: 1,000,000,000 BLAZE
 * 
 * Distribution:
 * - 12% Presale (120M)
 * - 18% Liquidity (180M)
 * - 8% Founder Immediate (80M)
 * - 12% Founder Vesting (120M) - 6 months lock
 * - 20% Community Rewards (200M)
 * - 15% Treasury (150M)
 * - 10% Team (100M)
 * - 5% Strategic Partners (50M)
 */
contract BlazeTokenPresale is ERC20, ERC20Burnable, ERC20Pausable, Ownable, ReentrancyGuard {

    // Distribution Wallets
    address public presaleContract;
    address public liquidityWallet;
    address public founderImmediateWallet;
    address public founderVestingWallet;
    address public communityWallet;
    address public treasuryWallet;
    address public teamWallet;
    address public strategicWallet;

    // Token Amounts (1 Billion Total)
    uint256 private constant PRESALE = 120_000_000 * 10**18;          // 12%
    uint256 private constant LIQUIDITY = 180_000_000 * 10**18;        // 18%
    uint256 private constant FOUNDER_IMMEDIATE = 80_000_000 * 10**18; // 8%
    uint256 private constant FOUNDER_VESTING = 120_000_000 * 10**18;  // 12%
    uint256 private constant COMMUNITY = 200_000_000 * 10**18;        // 20%
    uint256 private constant TREASURY = 150_000_000 * 10**18;         // 15%
    uint256 private constant TEAM = 100_000_000 * 10**18;             // 10%
    uint256 private constant STRATEGIC = 50_000_000 * 10**18;         // 5%

    // Burning Mechanism
    uint256 public totalBurned;
    uint256 public constant BURN_RATE_TRANSFER = 10; // 0.10%
    uint256 public constant BURN_RATE_SWAP = 50;     // 0.50%

    // Vesting
    uint256 public vestingStartTime;
    uint256 public constant VESTING_DURATION = 180 days; // 6 months
    uint256 public vestedAmount;

    event TokensBurned(address indexed from, uint256 amount, string reason);
    event VestingReleased(address indexed beneficiary, uint256 amount);

    constructor(
        address _presaleContract,
        address _liquidityWallet,
        address _founderImmediateWallet,
        address _founderVestingWallet,
        address _communityWallet,
        address _treasuryWallet,
        address _teamWallet,
        address _strategicWallet
    ) ERC20("Blaze Token", "BLAZE") Ownable(msg.sender) {
        require(_presaleContract != address(0), "Invalid presale contract");
        require(_liquidityWallet != address(0), "Invalid liquidity wallet");
        require(_founderImmediateWallet != address(0), "Invalid founder immediate wallet");
        require(_founderVestingWallet != address(0), "Invalid founder vesting wallet");
        require(_communityWallet != address(0), "Invalid community wallet");
        require(_treasuryWallet != address(0), "Invalid treasury wallet");
        require(_teamWallet != address(0), "Invalid team wallet");
        require(_strategicWallet != address(0), "Invalid strategic wallet");

        presaleContract = _presaleContract;
        liquidityWallet = _liquidityWallet;
        founderImmediateWallet = _founderImmediateWallet;
        founderVestingWallet = _founderVestingWallet;
        communityWallet = _communityWallet;
        treasuryWallet = _treasuryWallet;
        teamWallet = _teamWallet;
        strategicWallet = _strategicWallet;

        // Mint tokens according to tokenomics
        _mint(_presaleContract, PRESALE);
        _mint(_liquidityWallet, LIQUIDITY);
        _mint(_founderImmediateWallet, FOUNDER_IMMEDIATE);
        _mint(address(this), FOUNDER_VESTING); // Vested tokens held by contract
        _mint(_communityWallet, COMMUNITY);
        _mint(_treasuryWallet, TREASURY);
        _mint(_teamWallet, TEAM);
        _mint(_strategicWallet, STRATEGIC);

        vestingStartTime = block.timestamp;
    }

    /**
     * @dev Release vested tokens to founder
     */
    function releaseVesting() external nonReentrant {
        require(msg.sender == founderVestingWallet || msg.sender == owner(), "Not authorized");

        uint256 releasable = calculateReleasableAmount();
        require(releasable > 0, "No tokens to release");

        vestedAmount += releasable;
        _transfer(address(this), founderVestingWallet, releasable);

        emit VestingReleased(founderVestingWallet, releasable);
    }

    /**
     * @dev Calculate how many tokens can be released
     */
    function calculateReleasableAmount() public view returns (uint256) {
        if (block.timestamp < vestingStartTime) {
            return 0;
        }

        uint256 elapsed = block.timestamp - vestingStartTime;
        uint256 totalVestable = FOUNDER_VESTING;

        if (elapsed >= VESTING_DURATION) {
            // Full vesting period passed
            return totalVestable - vestedAmount;
        }

        // Linear vesting
        uint256 vested = (totalVestable * elapsed) / VESTING_DURATION;
        return vested - vestedAmount;
    }

    /**
     * @dev Get vesting info
     */
    function getVestingInfo() external view returns (
        uint256 totalAmount,
        uint256 releasedAmount,
        uint256 releasableAmount,
        uint256 remainingTime
    ) {
        totalAmount = FOUNDER_VESTING;
        releasedAmount = vestedAmount;
        releasableAmount = calculateReleasableAmount();

        if (block.timestamp >= vestingStartTime + VESTING_DURATION) {
            remainingTime = 0;
        } else {
            remainingTime = (vestingStartTime + VESTING_DURATION) - block.timestamp;
        }
    }

    /**
     * @dev Override transfer to implement burn mechanism
     */
    function _update(
        address from,
        address to,
        uint256 value
    ) internal virtual override(ERC20, ERC20Pausable) {
        // Exempt addresses from burn
        bool isExempt = from == address(0) || 
                        to == address(0) ||
                        from == address(this) ||
                        from == liquidityWallet ||
                        to == liquidityWallet ||
                        from == treasuryWallet ||
                        to == treasuryWallet ||
                        from == communityWallet ||
                        to == communityWallet ||
                        from == presaleContract ||
                        to == presaleContract;

        // Apply burn on transfers
        if (!isExempt && BURN_RATE_TRANSFER > 0) {
            uint256 burnAmount = (value * BURN_RATE_TRANSFER) / 10000;
            if (burnAmount > 0) {
                super._update(from, address(0), burnAmount);
                totalBurned += burnAmount;
                emit TokensBurned(from, burnAmount, "Transfer burn");
                value -= burnAmount;
            }
        }

        super._update(from, to, value);
    }

    /**
     * @dev Burn tokens from treasury (buyback & burn)
     */
    function burnFromTreasury(uint256 amount) external onlyOwner {
        require(amount > 0, "Amount must be greater than 0");
        _burn(treasuryWallet, amount);
        totalBurned += amount;
        emit TokensBurned(treasuryWallet, amount, "Treasury buyback & burn");
    }

    /**
     * @dev Pause token transfers (emergency only)
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause token transfers
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Get token statistics
     */
    function getTokenStats() external view returns (
        uint256 circulatingSupply,
        uint256 burnedSupply,
        uint256 vestedSupply,
        uint256 effectiveSupply
    ) {
        uint256 totalSupply = totalSupply();
        circulatingSupply = totalSupply;
        burnedSupply = totalBurned;
        vestedSupply = FOUNDER_VESTING - vestedAmount;
        effectiveSupply = totalSupply - totalBurned - vestedSupply;
    }
}

